import logo from '../waffle_logo.svg';
import '../css/Search.css';
import { useState } from 'react';

function Search(search) {

  return (
    <div className='Search'>
        <span className='Searchst'> 이름 검색:</span>
        <div className='Searchmerge'>
          <input type='text' value={search}  id="SearchInput" placeholder="검색어 입력" onChange={SearchChange}></input>
          <img className='Searchicon' src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/icon/search.png" alt={logo} />
        </div>
      </div>
  );
}

export default Search;
